import React, { Component } from "react";
import "../../index.css";

class Section2 extends Component {
  render() {
    return (
            <section class="py-5">
              <div class="container">
                <div class="kotak">
                  <div class="row">
                    <div class="col md-5">
                      <div class="section1">
                        <label>Kami siap<br/> membantu Anda</label>
                        <p>Apabila Anda ingin mengetahui lebih lanjut mengenai Udana. Silahkan menghubungi kami</p>
                      </div>
                    </div>

                    <div class="col md-5">
                    </div>
                  </div>
                </div>
              </div>
            </section>
    )
  }
}

export default Section2;
